import React, {Component} from "react";
import Tilt from 'react-parallax-tilt';
import 'Logo'

const Logo = () => {
    return (
        <div className="ma3 mt0">
            <Tilt className="Tilt br2 shadow-3" options={{max: 55}} style={{ height:100, width: 100}}>
                <div style={{}}>
                    <h1>HI</h1>
                </div>
            </Tilt>

        </div>
    )
}

export default Logo;
